const kirby = 'https://www.youtube.com/watch?v=zM-LfbFquuQ&list=PLsWOEapDJOmbs_Dm_rHar4D8htMOPLJvF&index=2'
const animalCrossing = ''
const BTSYoutube = () => (

        <div className="Player">
            <ReactPlayer
            url="https://www.youtube.com/watch?v=XCq7ySTR_Is&list=PLsWOEapDJOmbs_Dm_rHar4D8htMOPLJvF&index=3"
            controls="on"
            width="650px"
            height="365.625px"
            volume="0.5" />
        </div>
);

